    $maxid = get_field_sql('SELECT '.sql_max('id').' FROM '.$CFG->prefix.'facetoface_sessions_dates');
    // make sure sequence is higher than highest ID
    bump_sequence('facetoface_sessions_dates', $CFG->prefix, $maxid);
    // print output
    // 1 dot per 10 inserts
    if($i%10==0) {
        print ".";
        flush();
    }
    // new line every 200 dots
    if($i%2000==0) {
        print $i." <br>";
    }
    $i++;
}
print "<br>";
